import ReactFullpage from '@fullpage/react-fullpage';
import { BlogArea } from './Components/Area/BlogArea'

function App() {
  const navigationConfig = {
    navigation: {
      position: 'right',
      tooltips: ['page1', 'page2', 'Blog'],
      menu: '#menu',
      anchors: ['page1', 'page2', 'blog'],
      showActiveTooltip: true,
      activeClass: 'active',
      scrollingSpeed: 1000,
      css3: true,
      background: 'transparent',
      touch: true,
      keyboardScrolling: true,
      animateAnchor: true,
      onLeave: (origin, destination, direction) => {
        console.log('onLeave', { origin, destination, direction });
      },
      afterLoad: (origin, destination, direction) => {
        console.log('afterLoad', { origin, destination, direction });
      },
    },
  };

  return (
    <>
      <ReactFullpage
        //fullpage options
        licenseKey={"your licencekey here"}
        {...navigationConfig}
        render={({ state, fullpageApi }) => {
          return (
            <ReactFullpage.Wrapper>
              <div id='page1' className="section">page1</div>
              <div  id='page2' className="section">page2</div>
              <BlogArea />
            </ReactFullpage.Wrapper>
          );
        }}
      />
      <div id="menu">
        <ul>
          <li data-menuanchor="page1"><a href="#page1">page1</a></li>
          <li data-menuanchor="page2"><a href="#page2">page2</a></li>
          <li data-menuanchor="blog"><a href="#blog">Blog</a></li>
        </ul>
      </div>
    </>
  );
}

export default App;
